  return (
    <div className='frame f1' style={{ width: '100%', height: '10vh', marginTop: '5vh', padding:'10px' }}>
      Current Company: {currentCompanyName}<br />
      Designation: {currentRole} <br />
      Duration : May 2022 to Present
    </div>
  )
}

